@a411 Kāds sakars ar čekistiem? :D \
Es vienkārši nesaprotu priekškam ir jāraksta tādas lietas?\
Naidu kurinam? ;/

Jau tagad veidojas nejēdzīgi satiksmes korķi Maskavas ielā,kuri kļūs vēl lielāki.\
Atkal pārtiku tirgos apnikusī nekvalitatīvā Maxima (kādēļ nevarētu ienākt piemēram Carefour ? ).Būs daži jauni lupatu zīmoli (Van Graaf).\
Kopumā Lietuvas Akropoļu kopija...;

Kungam latviska* latviešu valoda.\
\
*&quot;priekš KNAB&quot;

Ощущения от интервью : &quot;Я не знаю, я не специалист в данном вопросе, я пока не решила как решать проблему ......&quot; . Сплошные НЕТ в ответах , кроме готовности начать изучение вопроса как только назначат министром.....\
Если бы все так проходили СОБЕСЕДОВАНИЕ при приеме на работу - вот веселье то было бы , сплошный цирк на работе - вместо бизнеса !!\
Напомнило - &quot;Сначала начнем драку, а там посмотрим кто кого !&quot;

Лично мне наплевать на интересы местной олигархии, больше волнует вот что:\
&quot;Как известно, при сжигании отходов в воздух попадает много крайне опасных веществ, таких как диоксины и тяжелые металлы. Даже самые дорогие из существующих в мире систем очистки не в состоянии полностью уловить все ядовитые соединения. Сами проектировщики признаются, что за год завод будет выбрасывать в атмосферу более тонны веществ первого, самого высокого класса опасности.\
Большинство этих веществ имеют способность накапливаться в организме и могут отравлять его годами, приводя к изменениям работы иммунной и репродуктивной систем, нарушению гормонального обмена. Диоксины являются универсальными ядами, поражающими даже в ничтожных концентрациях всё живое. По данным научных исследований, для диоксинов не существует «порога действия», даже одна молекула способна спровоцировать рак. Действие диоксинов на организм человека сравнимо с действием ВИЧ. Они так же подрывают иммунную систему человека, что в результате может привести к смерти от более простого заболевания.&quot;
